import React from "react";
import { Field } from "formik";
import Password from "./Password";

function TextInput(props) {
  return (
    <Field
      name="password"
      as={Password}
      label="Passwordsdfdf"
      fullWidth
      required
    ></Field>
  );
}

export default TextInput;
